// src/pages/ReportList.tsx

import React, { useEffect, useState, useContext } from 'react';
import axios from '../utils/axiosInstance';
import { IReport } from '../types';
import {
  Container,
  Typography,
  Box,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Avatar,
  Tooltip,
  IconButton,
  CircularProgress,
  Alert,
} from '@mui/material';
import { Edit, Visibility } from '@mui/icons-material';
import { AuthContext } from '../context/AuthContext';
import { useNavigate } from 'react-router-dom';

const ReportList: React.FC = () => {
  const { role } = useContext(AuthContext);
  const [reports, setReports] = useState<IReport[]>([]);
  const [loading, setLoading] = useState<boolean>(true);
  const [error, setError] = useState<string | null>(null);
  const navigate = useNavigate();

  useEffect(() => {
    if (role !== 'admin') {
      setError('Access denied.');
      setLoading(false);
      return;
    }

    axios
      .get('/api/reports')
      .then((response) => {
        setReports(response.data.reports);
        setLoading(false);
      })
      .catch((err) => {
        console.error('Error fetching reports:', err);
        setError('Failed to load reports.');
        setLoading(false);
      });
  }, [role]);

  const handleViewReport = (reportId: string) => {
    navigate(`/reports/${reportId}`); // Navigate to a detailed report page
  };

  return (
    <Container maxWidth="xl" sx={{ mt: 4, mb: 4 }}>
      <Typography variant="h4" align="center" gutterBottom>
        דוחות מלאי
      </Typography>

      {loading ? (
        <Box sx={{ display: 'flex', justifyContent: 'center', mt: 4 }}>
          <CircularProgress />
        </Box>
      ) : error ? (
        <Alert severity="error">{error}</Alert>
      ) : reports.length === 0 ? (
        <Alert severity="info">אין דוחות זמינים להצגה.</Alert>
      ) : (
        <TableContainer component={Paper}>
          <Table aria-label="reports table">
            <TableHead>
              <TableRow>
                <TableCell><strong>סניף</strong></TableCell>
                <TableCell><strong>נשלח על ידי</strong></TableCell>
                <TableCell><strong>תאריך</strong></TableCell>
                <TableCell><strong>הערות</strong></TableCell>
                <TableCell align="center"><strong>פעולות</strong></TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {reports.map((report) => (
                <TableRow key={report._id} hover>
                  <TableCell>{report.branch.name}</TableCell>
                  <TableCell>{report.sentBy.username}</TableCell>
                  <TableCell>
                    {new Date(report.dateSent).toLocaleDateString('he-IL', {
                      year: 'numeric',
                      month: 'long',
                      day: 'numeric',
                      hour: '2-digit',
                      minute: '2-digit',
                    })}
                  </TableCell>
                  <TableCell>{report.notes || 'אין הערות'}</TableCell>
                  <TableCell align="center">
                    <Tooltip title="צפה בדוח">
                      <IconButton
                        color="primary"
                        onClick={() => handleViewReport(report._id)}
                      >
                        <Visibility />
                      </IconButton>
                    </Tooltip>
                    {/* Future Enhancement: Edit functionality can be added here */}
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      )}
    </Container>
  );
};

export default ReportList;
